import React, { Component } from 'react';
import '../sass/styles.css';
import gif from '../prenuvo_db/862625ef/1361ae6e/bw-gif.gif'
import gridlist from '../prenuvo_db/grid.json'

const getImage = (image, callback) => {
  const reader = new FileReader()
  reader.addEventListener('load', ()=> callback)
}


export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: false,

    };
  }

  componentWillMount() {
    const keys = Object.keys(gridlist)
    const imagesFolderNames = keys.map(key => gridlist[key].path)
    console.log(imagesFolderNames)
  }

  onImgLoad = ({ target: img }) => {
    this.setState({
      width: img.width,
      height: img.height,
    });
  }

  onImgError = e => {
    e.target.src = '/path/no-picture.jpg';
    this.setState({
      error: true,
    });
  }

  render() {
    const { width, height, error } = this.state;
    console.log(width, height, error);
    console.log(gridlist)
    return (
      <div>
       <h1>IMAGES</h1> 
        <div>
          <img src={gif} onLoad={this.onImgLoad} alt="prenuvo" />
        </div>

      </div>
    )
  }
}
